import React from "react"

const Email = ({emailData}) => {
    return(
        <div className="email-container">
            <h1>Enter your email here</h1>
            <p><strong>Email:</strong> {welcomeData.title || "No title provided"}</p>
        </div>
    )
}

export default Email;
